import React, {Component} from 'react'
import Mobiles from './components/phones';
import './App.css'

class App extends Component {
  render() {
      return (
          <Mobiles mobiles={this.state.mobile} />
      )
  }

  state = {
      mobile: []
  };

  componentDidMount() {
      fetch('http://localhost:8080/phones')
          .then(res => res.json())
          .then((data) => {
              this.setState({ mobile: data })
          })
          .catch(console.log)
  }
}

export default App;
